import React from "react";
import './Styles.css';


const Red = () => {
	return (
		<>
		<div className="trafic">
			<div className="lighter red active"></div>
			<div className="lighter yellow"></div>
			<div className="lighter green"></div>
		</div>	
		</>
	)
}

export default Red
